Una domenica davvero sprint per la canoa di velocità! 

@Liberto_Andrea vince il campionato mondiale K1 200 mt con una finale pazzesca dove riesce ad arrivare primo col tempo di 34''78.

Le emozioni sportive non finiscono, è sempre grande Italia. https://t.co/eoi2z1wGnz

Questo gol è da Campione con la “C” maiuscola. Fuoriclasse assoluto, mente superiore, classe sopraffina, il miglior numero 9 della Serie A TIM 2021/22. Per distacco. 

